import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
//import "bootstrap/dist/css/bootstrap.css";

ReactDOM.render(
  <div style={{ background: "lightgrey", margin: "20px", padding: "20px" }}>
    <App />
  </div>,
  document.getElementById("root")
);
